import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";


function Details(){
    const [details,setDetails]=useState("")

    // const {empid}=useParams
    const useParams={empid}
    
    useEffect(()=>{
        fetch("http://localhost:3009/seconddata/"+useParams)
        .then((res) => {
            return res.json()
        })
        .then((resp) => {
            setDetails(resp)
            console.log(resp)
        })
    },[])

    return(
        <div>
           {details.map=((ourdata)=>(
             <p>{ourdata.id}</p>,
             <p>{ourdata.name}</p>


           ))}
        </div>
    )
}
export default Details;
